import React from "react";
import { useStats } from "../hooks/useStats";

function Stats() {
  const stats = useStats();
  if (!stats) return <p>Loading Stats...</p>;
  console.log(stats);

  return (
    <section>
      <h3>Confirmed:</h3>
      <span>{stats.confirmed.value}</span>
    </section>
  );
}

const IndexPage = props => {
  return (
    <main>
      <Stats />
    </main>
  );
};

export default IndexPage;
